import "./App.css";
import Home from "./pages/Home";
import Items from "./components/Items";
import { BrowserRouter, Routes, Route, Link, Swi } from "react-router-dom";
import Register from "./pages/Register";
import Login from "./pages/Login";
import Cart from "./pages/Cart";
import Product from "./components/Product";
import CartContext from "./CartContext";

function App() {
  return (
    <div className="App">
      <CartContext.Provider value={{ name: "Shravani" }}>
        <Switch>
          <BrowserRouter>
            <Routes>
              <Route path="/login/:id" element={<Login />} />
              <Route path="/signin/:id" element={<Register />} />
              <Route path="/details/:id" element={<Items />} />
              <Route path="/product/:id/:name" element={<Product />} />
              <Route path="/cart/:id/:name" element={<Cart />} />
              <Route path="/cart/:id" element={<Cart />} />
              <Route path="/" element={<Home />} />
            </Routes>
          </BrowserRouter>
        </Switch>
      </CartContext.Provider>
    </div>
  );
}

export default App;
